(1,1,'2023-05-12 09:32:34','2024-01-11 15:02:27',6,'terminated',1,'Semesterbeiträge','michelle.storandt','Studierendenrat (StuRa)','',NULL,'andere','Haushaltsplan','2023-04-01','2024-03-31',NULL),
(2,2,'2023-04-04 00:00:00','2024-01-11 15:02:24',8,'terminated',1,'Hosting',NULL,'Referat IT','',NULL,'andere','Haushaltsplan','2023-04-01','2024-03-31',NULL),
(3,3,'2023-07-25 00:00:00','2024-01-11 14:44:09',9,'terminated',1,'Hackathon Dresden','lukas','Fachschaftsrat IA','',NULL,'stura','2023-08-03-F01','2023-08-05','2023-08-07','Für die überregionale Vernetzung unter den IT-lern sowie zum Ausbau der IT-Infrastruktur soll ein Hackathon stattfinden. An diesem nehmen ausschließlich ehrenamtlich Aktive teil. Der Hackathon soll vom 5.8.22 bis 7.8.22 in Dresden stattfinden. Es ist noch unklar,ob die Kosten für die Unterkunft benötigt werden.'),
(4,3,'2023-08-11 19:44:28','2024-01-11 14:44:05',5,'terminated',1,'Hackathon Thüringen','lukas','Fachschaftsrat IA','',NULL,NULL,NULL,'2023-10-28','2023-11-13','Wir wollen erneut einen Hackathon organisieren. Dieses Mal soll er in Thüringen stattfinden. Es ist noch nicht genau geplant,an welchem Wochenende dies passieren soll,aber es gibt schon zwei Terminvorschläge (28.-30.10.22 oder 11.-13.11.22). Da es inzwischen das 9 EURO-Ticket nicht mehr geben wird,werden die Fahrtkosten höher ausfallen. Der Ort ist noch unbekannt. Aktuell wird Jena präferiert.'),
(5,2,'2023-04-01 00:00:00','2024-01-11 14:43:53',7,'terminated',1,'Exkursion zu Bosch','michelle','Fachschaftsrat EI','',NULL,'stura','2023-04-13-F01','2023-05-31','2023-08-31','Wir planen eine Exkursion am 23.06.22 in das Bosch-Werk in Eisenach. Dort wird Sensorik und Elektrik gefertigt. Die Exkursion bietet Einblicke in den Musterbau,also Forschung und Entwicklung ebendieser Teile. Der Fokus für diese Exkursion liegt dabei bei den Studiengängen Mikro- und Nanotechnologie und Leistungselektronik,aber auch für Studierende aus anderen Studiengängen kann die Exkursion interessant sein. \r\nDazu beantragen wir 655€ für die Fahrtkosten. Dies kommt dadurch zustande,dass das günstigste Angebot in Höhe von 580€ am 7.6. ausläuft. Die Preise der weiteren Angebote können erfragt werden oder im Protokoll im Abschnitt 2.2 Exkursionen nachgelesen werden.\r\nDie Teilnehmerzahl ist auf 18 Personen beschränkt.'),
(6,2,'2023-04-09 00:00:00','2024-01-11 14:45:17',6,'terminated',1,'Darlehen A.S.','michelle','Referat Soziales','',NULL,'stura','2023-04-13-F02','2023-05-01','2023-10-30','Die Person benötigt ein Sozialdarlehen. Die Rückzahlung ist aus Sicht des Referat Soziales und des Referat Finanzens gesichert. Genauere Informationen gibt es auf der Sitzung.'),
(7,2,'2023-08-11 20:39:23','2024-10-16 13:22:43',5,'revoked',1,'Erstiwoche 2023','lukas','Studierendenrat (StuRa)','',NULL,'stura',NULL,'2023-10-02','2023-10-09',NULL),
