(10,2,'2023-08-11 20:58:07','2024-01-11 14:44:17',6,'terminated',1,'Fachschaftsparty',NULL,'Fachschaftsrat WM','',NULL,'fsr-ref',NULL,'2023-06-15','2023-06-16','Um den FSR unter den Studierenden bekannter zu machen,veranstalten wir eine Party. Zum anlocken vieler Interessierter soll es ein Fass Freibier geben.'),
