(27,6,'2024-04-04 12:39:59','2025-02-04 13:41:17',8,'ok-by-stura',6,'Theaterfahrt','michelle','Referat Kultur','',NULL,'stura','25-42','2025-02-01','2025-02-01','Eine Theaterfahrt mit einem angemieteten Bus dient der Förderung der kulturellen Belange der Studierendenschaft. Sie ermöglicht allen Studierenden,günstig und ohne Einschränkungen durch den unpassenden Zug/Busverkehr,die Teilnahme an einer kulturellen Veranstaltung. Dies entspricht dem Bildungs- und Gemeinschaftsauftrag der Studierendenschaft,da kulturelle Aktivitäten die persönliche und akademische Entwicklung bereichern,den interdisziplinären Austausch fördern und das soziale Miteinander stärken. Zudem trägt die gemeinsame Anreise zur Nachhaltigkeit bei,indem individuelle Fahrten vermieden und Emissionen reduziert werden.'),
